  event.preventDefault();
  console.log(event.target.wmail.value)
  console.log(event.target.password.value)
}


const Login = () => {
  return (
    <div className="App-header">
      <div>
        <TiShoppingCart className="navbarlogin"></TiShoppingCart>
      </div>
      <div>
        <input
          type="text"
          placeholder="Email Id"
          required
          className="inputlogin"
          name="email"
        />
      </div>
      <div>
        <input
          type="password"
          placeholder="password"
          required
          className="inputlogin" name="password"
        />
      </div>
      <div>
        <a href="/home">
          <button className="buttonforlogin" onCilck={handleLogin}>Login</button>
        </a>
      </div>
    </div>
  );
};

export default Login;
